import React from "react";
import { Row, Col, Container } from "react-bootstrap";

const Strategy = () => {
  return (
    <section
      id="strategy"
      className="my-3"
      style={{
        paddingTop: "4rem",
        fontFamily: "primary-font",
        backgroundColor: "#F9E95D",
        width: 1577,
        height: 700,
      }}
    >
      <Container>
        <div style={{ textAlign: "center" }}>
          <h1 style={{ fontSize: 55 }}>Our strategy</h1>
          <p
            style={{
              fontSize: 25,
              width: "70%",
              marginTop: "2rem",
              marginLeft: "13rem",
            }}
          >
            Lorem ipsum lorem ipsum lorem ipsum Lorem ipsum lorem ipsum lorem
            ipsum Lorem ipsum lorem ipsum lorem ipsum Lorem ipsum lorem ipsum
            lorem ipsum Lorem ipsum lorem ipsum lorem ipsum Lorem ipsum lorem
            ipsum lorem ipsum Lorem ipsum lorem ipsum lorem ipsum
          </p>
        </div>
        <Row
          className="g-1"
          style={{
            display: "flex",
            justifyContent: "center",
            marginTop: "8rem",
            marginLeft: "11rem",
          }}
        >
          <Col md={3}>
            <div
              style={{
                width: 30,
                height: 30,
                borderRadius: "50%",
                backgroundColor: "#2D2828",
              }}
            ></div>
            <h2 className="mt-4" style={{ fontSize: 30 }}>
              Planning
            </h2>
          </Col>

          <Col md={3}>
            <div
              style={{
                width: 30,
                height: 30,
                borderRadius: "50%",
                backgroundColor: "#2D2828",
              }}
            ></div>
            <h2 className="mt-4" style={{ fontSize: 30 }}>
              Development
            </h2>
          </Col>

          <Col md={3}>
            <div
              style={{
                width: 30,
                height: 30,
                borderRadius: "50%",
                backgroundColor: "#2D2828",
              }}
            ></div>
            <h2 className="mt-4" style={{ fontSize: 30 }}>
              Delivery
            </h2>
          </Col>

          <Col md={3}>
            <div
              style={{
                width: 30,
                height: 30,
                borderRadius: "50%",
                backgroundColor: "#2D2828",
              }}
            ></div>
            <h2 className="mt-4" style={{ fontSize: 30 }}>
              Growth
            </h2>
          </Col>
        </Row>

        <div
          style={{
            border: "0.5px solid black",
            width: 1400,
            left: 0,
            position: "absolute",
            marginTop: "5rem",
          }}
        ></div>
      </Container>
    </section>
  );
};

export default Strategy;
